import React, { useState, useEffect } from 'react';
import { connectWebSocket, disconnectWebSocket, sendUpdateTaskMessage } from '../websocket';

const WebSocketTestComponent = () => {
  const [messages, setMessages] = useState([]);
  const userId = 1; // Beispiel-Benutzer-ID
  const task = { taskId: 3, text: 'sdds', deadline: null, planDate: null, userId: 1, categoryId: 1, completed: false, type: 'TASK_UPDATE' }; // Beispiel-Task

  useEffect(() => {
    const handleWebSocketMessage = (message) => {
      console.log('Received WebSocket message:', message);
      setMessages((prevMessages) => [...prevMessages, message]);
    };

    connectWebSocket(userId, handleWebSocketMessage);

    return () => {
      disconnectWebSocket();
    };
  }, [userId]);

  const handleSendMessage = () => {
    const { taskId, ...taskSaveDTO } = task; // Extrahiere taskId und trenne von taskSaveDTO
    const numericTaskId = Number(taskId); // Konvertiere taskId in eine Zahl
    if (isNaN(numericTaskId)) {
      console.error('taskId is not a number:', taskId);
      return;
    }
    console.log('Sending update task message with taskId:', numericTaskId);
    sendUpdateTaskMessage(numericTaskId, taskSaveDTO);
  };

  return (
    <div>
      <h2>WebSocket Test Component</h2>
      <button onClick={handleSendMessage}>Send Update Task Message</button>
      <ul>
        {messages.map((message, index) => (
          <li key={index}>{JSON.stringify(message)}</li>
        ))}
      </ul>
    </div>
  );
};

export default WebSocketTestComponent;
